import React from "react";

const About = () => {
  return (
    <section id="about" className="h-screen bg-blue-100 flex justify-center text-center items-center" data-scroll-section>
      Who are we? We are a women-led tech startup (previously known as Mynd)
      with an aim to be India's leading behavioral health platform for the
      youth. We help you adapt to difficult situations. And we adapt to your
      unique needs. From activities that fit seamlessly into your daily routine
      to experienced therapists that will guide you - we have it all
    </section>
  );
};

export default About;
